import React from 'react'
import { StyleSheet, Text, View } from 'react-native'

const Footer = () => {
    return (
        <View>
            <Text style={styles.footer}>FZ Smart Que By AIRPORTS OF THAILAND PLC. v. 1.0.0</Text>
        </View>
    )
}

export default Footer

const styles = StyleSheet.create({})
